t.add("answer.1", "O AwardWallet.com apresenta 3 recursos principais: <ol class=\"counter-list\"> <li>O AwardWallet foi projetado para auxiliar no acompanhamento de v\u00e1rios programas de fidelidade para voc\u00ea e sua fam\u00edlia. N\u00f3s fazemos isto entrando nas v\u00e1rias contas de programas de recompensa e obtendo os saldos em seu nome. N\u00f3s vamos recuperar ou calcular a data de expira\u00e7\u00e3o, status elite, etc. e mostrar as informa\u00e7\u00f5es em um relat\u00f3rio \u00fanico de f\u00e1cil entendimento.<\/li> <li>O AwardWallet vai ajud\u00e1-lo a gerir seus planos de viagem por meio de nosso recurso \"<a href=\"\/trips\/\">Viagens<\/a>\", na Internet e no aplicativo para dispositivos m\u00f3veis.<\/li> <li>O AwardWallet ajuda voc\u00ea a resgatar suas milhas em voos internacionais de primeira classe ou classe executiva. Basta <a href=\"\/awardBooking\/add\">enviar uma solicita\u00e7\u00e3o de resgate<\/a> e nossa equipe vai trabalhar para encontrar o melhor itiner\u00e1rio para voc\u00ea.<\/li> <\/ol>", "faq", "pt");
t.add("answer.10", "<div class=\"secure-information\"> <div class=\"row\"> <div class=\"thumb\"><i class=\"faq-icon-1\">&nbsp;<\/i><\/div> <div class=\"description\"><p>N\u00f3s sempre usamos <span class=\"red\">tecnologias de criptografia padr\u00e3o de mercado<\/span> ao transferir e receber dados de clientes de nosso website. Tomamos as medidas de seguran\u00e7a apropriadas em nossas instala\u00e7\u00f5es f\u00edsicas para prote\u00e7\u00e3o contra perda, uso inapropriado ou altera\u00e7\u00e3o das informa\u00e7\u00f5es que coletamos de voc\u00ea.<\/p> <\/div> <\/div> <div class=\"row\"> <div class=\"thumb\"><i class=\"faq-icon-2\">&nbsp;<\/i><\/div> <div class=\"description\"> <p>N\u00f3s incentivamos nossos usu\u00e1rios a <a href=\"https:\/\/awardwallet.com\/user\/edit.php\">habilitarem a <\/a> <span class=\"red\">autentica\u00e7\u00e3o por dois fatores<\/span> em suas contas. Desta forma, mesmo se alguma pessoa roubar a sua senha AwardWallet ou tiver acesso ao seu computador, ela ainda precisar\u00e1 de uma forma de gerar um c\u00f3digo \u00fanico para acessar o seu perfil.<\/p> <\/div> <\/div> <div class=\"row\"> <div class=\"thumb\"><i class=\"faq-icon-3\">&nbsp;<\/i><\/div> <div class=\"description\"> <p>Todas os seus <span class=\"red\">dados sigilosos s\u00e3o criptografados<\/span> em nosso banco de dados seguro. Sempre que transferimos suas senhas, usamos protoclo seguro https (livre de heartbleed). Tamb\u00e9m damos voc\u00ea a possibilidade de armazenar suas senhas localmente em um cookie. No entanto, h\u00e1 vantagens em armazenar as suas senhas em nosso banco de dados; por exemplo, isto nos permite verificar automaticamente os seus saldos e mandar um relat\u00f3rio quando houver altera\u00e7\u00e3o. Milhares de pessoas confiam a n\u00f3s os dados de suas contas e o nosso servi\u00e7o est\u00e1 bastante amadurecido (lan\u00e7amos nosso website em 2004); o website foi criado e est\u00e1 hospedado nos Estados Unidos da Am\u00e9rica.<\/p> <\/div> <\/div> <div class=\"row\"> <div class=\"thumb\"><i class=\"faq-icon-4\">&nbsp;<\/i><\/div> <div class=\"description\"> <p>N\u00f3s <span class=\"red\">participamos em um concurso de recompensas<\/span> em conjunto com a&nbsp;Cobalt&nbsp;<a href=\"https:\/\/cobalt.io\/awardwallet\">https:\/\/cobalt.io\/awardwallet<\/a> onde pagamos hackers para encontrarem problemas de seguran\u00e7a em nosso servi\u00e7o.<\/p> <\/div> <\/div> <\/div> &nbsp; <p><strong>Finalmente, para os interessados no aspecto t\u00e9cnico, aqui h\u00e1 mais informa\u00e7\u00f5es:<\/strong><\/p> <ul> <li>Suas senhas no AwardWallet s\u00e3o processadas com bcrypt, cost:13, e \"salt\" \u00fanico para cada usu\u00e1rio.<\/li> <li>No caso das senhas que os usu\u00e1rio armazenam localmente em seus computadores, n\u00f3s usamos Rijndael (similar ao AES) de 256 bits.<\/li> <li>O cookie \"lembrar de mim\" \u00e9 um sha 256 hash&nbsp;de certos atributos do usu\u00e1rio<\/li> <li>As senhas de programas de fidelidade s\u00e3o criptografadas com uma chave RSA 1024.<\/li> <li>Se algu\u00e9m tentar entrar na sua conta usando \"for\u00e7a bruta\", nos o travaremos por um per\u00edodo de tempo ap\u00f3s tentativas inv\u00e1lidas de login.<\/li> <\/ul>", "faq", "pt");
t.add("answer.11", "Ap\u00f3s fazer login, \u00e9 necess\u00e1rio ir para \"<a class=\"a14pxBlue\" href=\"\/account\/list.php\">Contas<\/a>\". Nesta p\u00e1gina, voc\u00ea pode navegar para \"<a class=\"a14pxBlue\" href=\"\/account\/add.php\">Adicionar novo programa<\/a>\" no menu de navega\u00e7\u00e3o \u00e0 esquerda. Selecione um programa de recompensa na lista para que seja adicionado ao seu perfil. Observe que, antes de adicionar um programa, \u00e9 necess\u00e1rio saber o seu nome de usu\u00e1rio e senha do website do programa de fidelidade que informa o seu saldo. Se voc\u00ea n\u00e3o puder fazer login no website que fornece o saldo (por ex., no caso da Marriott seria <a class=\"a14pxBlue\" href=\"http:\/\/www.marriott.com\">http:\/\/www.marriott.com<\/a>), o AwardWallet tamb\u00e9m n\u00e3o ser\u00e1 capaz de consultar o seu saldo. Ap\u00f3s adicionar um programa ao seu perfil, ele ser\u00e1 exibido na se\u00e7\u00e3o \"<a class=\"a14pxBlue\" href=\"\/account\/list.php\">Saldo<\/a>\". L\u00e1, voc\u00ea pode clicar no bot\u00e3o \"Atualizar\" para recuperar automaticamente o saldo de um programa ou pode usar o bot\u00e3o \"Atualizar todos\" para atualizar automaticamente todos os programas de fidelidade do seu perfil. Observe que se as suas informa\u00e7\u00f5es de login estiverem corretas, voc\u00ea tamb\u00e9m poder\u00e1 usar o recurso de login autom\u00e1tico, para que o AwardWallet.com fa\u00e7a login automaticamente no website do programa (por ex., www.marriott.com). Desta forma, voc\u00ea poder\u00e1 ver quaisquer informa\u00e7\u00f5es adicionais sobre a sua conta. O recurso de login autom\u00e1tico est\u00e1 dispon\u00edvel para a maioria dos programas de recompensa com os quais trabalhamos. Para mais detalhes sobre o login autom\u00e1tico, veja esta dica:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/28-auto-login\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/28-auto-login\/<\/a>", "faq", "pt");
