t.add("answer.27", "<img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/27-1.png\" style=\"width: 650px; height: 59px;\" \/> <p style=\"line-height:1.5\">1. Indica que o saldo mudou nas \u00faltimas 24 horas<br \/> 2. Caixa para sele\u00e7\u00e3o da conta para outras a\u00e7\u00f5es<br \/> 3. Exibe mais detalhes da conta<br \/> 4. Login autom\u00e1tico desabilitado para esta conta<br \/> 5.&nbsp;\u00cdcone da alian\u00e7a do fornecedor<br \/> 6. Progresso para o status elite na alian\u00e7a<br \/> 7. Nome de usu\u00e1rio usado para login na conta<br \/> 8. N\u00famero da conta<br \/> 9. Indica\u00e7\u00e3o que a senha para esta conta est\u00e1 armazenada localmente no navegador<br \/> 10. Status elite atual no programa<br \/> 11. Progresso no status elite<br \/> 12. Saldo da conta<br \/> 13. A atualiza\u00e7\u00e3o em segundo plano foi desabilitada por motivos t\u00e9cnicos<br \/> 14. Mostra que \u00e9 a entrada personalizada e que o saldo n\u00e3o \u00e9 atualizado automaticamente<br \/> 15. Valor da \u00faltima altera\u00e7\u00e3o no saldo<br \/> 16. Mostra se a altera\u00e7\u00e3o foi positiva ou negativa<br \/> 17. Progresso at\u00e9 a sua meta definida<br \/> 18. Data de vencimento do saldo<br \/> 19. Mostra que a data de validade do saldo foi calculada<\/p>\n", "faq", "pt");
t.add("answer.28", "Se voc\u00ea convidar usu\u00e1rios e eles se cadastrarem no AwardWallet, voc\u00ea ganhar\u00e1 um upgrade gr\u00e1tis de 6 meses para cada 5 pessoas que se cadastrarem, mas ainda tem mais. Se <a href=\"\/agent\/invites.php\">qualquer dos seus convidados<\/a> pagar pelo AwardWallet Plus, voc\u00ea receber\u00e1 pontos de bonifica\u00e7\u00e3o proporcionais \u00e0 contribui\u00e7\u00e3o deles. Se os seus convidados n\u00e3o pagarem por upgrades, voc\u00ea n\u00e3o receber\u00e1 pontos. Ao atingir <a href=\"\/agent\/redeem.php\">valores m\u00ednimos pr\u00e9-determinados<\/a>, n\u00f3s converteremos esses pontos em milhas do programa \u00e0 sua escolha e depositaremos em sua conta. Para mais detalhes, veja esta dica:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/21-awardwallet-referrals\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/21-awardwallet-referrals\/<\/a>", "faq", "pt");
t.add("answer.29", "<a href=\"https:\/\/business.awardwallet.com\/\">A interface empresarial AwardWallet<\/a> foi desenvolvida para nossos clientes empresariais, enquanto o AwardWallet.com foi projetado para que indiv\u00edduos acompanhem seus programas de recompensa pessoais e de seus familiares. A interface empresarial foi desenvolvida para: <ol class=\"counter-list\"> <li>Controlar solicita\u00e7\u00f5es de reservas de recompensas para seus usu\u00e1rios (configura\u00e7\u00e3o adicional necess\u00e1ria para habilitar este recurso).<\/li> <li>Acompanhar programas empresariais de fidelidade, como o EasyBiz da Alaska Airlines ou o KLM BlueBiz.<\/li> <li>Ter v\u00e1rios usu\u00e1rios vinculados ao seu perfil. Enquanto a interface AwardWallet comum n\u00e3o foi projetada para controlar centenas ou milhares de contas vinculadas, a interface empresarial serve exatamente pra isso. Voc\u00ea pode vincular uma conta empresarial a viajantes que usam a interface normal do AwardWallet e eles podem escolher quais informa\u00e7\u00f5es precisam ser compartilhadas com a sua conta empresarial.&nbsp;Por exemplo, os viajantes podem escolher compartilhar apenas seus n\u00fameros de programas de fidelidade ou podem deixar que a conta empresarial&nbsp;administre e monitore completamente suas contas de recompensas.<\/li> <li>A interface empresarial permite a voc\u00ea controlar planos individuais de viagem de usu\u00e1rios.<\/li> <li>A interface empresarial \u00e9 fornecida com uma <a href=\"https:\/\/awardwallet.com\/api\/account\">API que permite a programa\u00e7\u00e3o da captura das informa\u00e7\u00f5es das contas<\/a>.&nbsp;<\/li> <\/ol>", "faq", "pt");
t.add("answer.30", "Este recurso s\u00f3 est\u00e1 dispon\u00edvel para contas empresariais (<a href=\"https:\/\/business.AwardWallet.com\">https:\/\/business.AwardWallet.com<\/a>). Se voc\u00ea tem uma conta empresarial AwardWallet, voc\u00ea pode programar a exporta\u00e7\u00e3o das suas contas conforme descri\u00e7\u00e3o em nossa API:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/api\/account\">https:\/\/awardwallet.com\/api\/account<\/a>", "faq", "pt");
t.add("answer.31", "<div class=\"flex\" style=\"-webkit-align-items: flex-start;\n    -ms-align-items: flex-start;\n    align-items: flex-start;\"> <div class=\"flex__info\"> <p>O OneCard AwardWallet \u00e9 um cart\u00e3o pl\u00e1stico do tamanho de um cart\u00e3o de cr\u00e9dito com uma tarja magn\u00e9tica (que permite a voc\u00ea fazer o check-in de voos nos quiosques de aeroportos). O cart\u00e3o traz todos os n\u00fameros das suas contas pessoais e n\u00fameros de telefones de programas impressos na frente e no verso. O cart\u00e3o pode conter at\u00e9 30 contas diferentes de programas de recompensas. Temos dois tipos de cart\u00e3o: gold e silver. Os associados do AwardWallet que t\u00eam mais de um milh\u00e3o de milhas e pontos no seu saldo somado receber\u00e3o um cart\u00e3o gold, enquanto os que t\u00eam menos de um milh\u00e3o de pontos receber\u00e3o um cart\u00e3o silver. Os cart\u00f5es podem ser enviados internacionalmente ou dentro dos Estados Unidos pelo Servi\u00e7o Postal dos Estados Unidos.<\/p> <br> <p>O OneCard tem um custo fixo de US$ 10 com entrega gr\u00e1tis em qualquer lugar do mundo. &nbsp;Mais detalhes podem ser encontrados <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/30-awardwallet-onecard\/\">aqui<\/a>.<\/p> <br> <\/div> <div class=\"flex__image\"><a href=\"#\"><img alt=\"\" src=\"\/images\/uploaded\/fck\/Image\/OneCardSmall.png\" style=\"margin-left: 20px; width: 283px; height: 182px;\" \/><\/a><\/div> <\/div>", "faq", "pt");
t.add("answer.32", "N\u00e3o, o OneCard AwardWallet n\u00e3o armazena nenhuma das suas senhas, portanto, caso voc\u00ea perca o seu cart\u00e3o, s\u00f3 ir\u00e1 perder seus n\u00fameros de conta, e n\u00e3o suas senhas.", "faq", "pt");
t.add("answer.33", "N\u00e3o. O AwardWallet \u00e9 completamente independente das cias. a\u00e9reas, redes de hot\u00e9is, cart\u00f5es de cr\u00e9dito e qualquer dos programas de recompensa controlados ou monitorados usando os nossos servi\u00e7os.", "faq", "pt");
t.add("answer.34", "Sim! Leia este comunicado de imprensa sobre o assunto:<br \/> <br \/> <a href=\"http:\/\/news.aa.com\/news\/news-details\/2013\/American-Airlines-and-AwardWallet-Offer-New-Reward-Tracking-Technology-for-AAdvantage-Members\/default.aspx\">http:\/\/news.aa.com\/news\/news-details\/2013\/American-Airlines-and-AwardWallet-Offer-New-Reward-Tracking-Technology-for-AAdvantage-Members\/default.aspx<\/a>", "faq", "pt");
t.add("answer.35", "Leia este comunicado de imprensa sobre o assunto:<br \/> <br \/> <a href=\"https:\/\/business.awardwallet.com\/?Register=1\">https:\/\/business.awardwallet.com\/?Register=1<\/a><br \/> <br \/> Caso voc\u00ea tenha uma conta pessoal no AwardWallet, voc\u00ea pode criar uma conta empresarial vinculada \u00e0 sua conta pessoal para que voc\u00ea possa acessar as duas contas com o mesmo login e senha. Para fazer isto, clique neste link:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/user\/create-business-account\">https:\/\/awardwallet.com\/user\/create-business-account<\/a>\n", "faq", "pt");
