t.add("answer.37", "Mais ou menos. Em primeiro lugar, com a vers\u00e3o gratuita, voc\u00ea pode clicar em \"Editar\" em qualquer programa para ver sua validade (mesmo se estiver oculta na exibi\u00e7\u00e3o da lista). Est\u00e1 literalmente a um clique. Em segundo lugar, voc\u00ea pode desagrupar os seus programas (bot\u00e3o \"Exibi\u00e7\u00f5es\", canto direito superior -> \"Desagrupar contas (lista simples)\") e, ent\u00e3o, ordenar os seus programas pela data de validade, nome do programa ou saldo em ambas as dire\u00e7\u00f5es (ascendente ou descendente). Como n\u00f3s sempre exibimos as tr\u00eas datas de expira\u00e7\u00e3o mais pr\u00f3ximas, reordenando os seus programas voc\u00ea pode controlar quais expira\u00e7\u00f5es s\u00e3o vis\u00edveis.", "faq", "pt");
t.add("answer.39", "Em primeiro lugar, voc\u00ea precisa ter privil\u00e9gios de administrador no seu computador para poder instalar essa extens\u00e3o; em outras palavras, voc\u00ea deve poder instalar outros programas no seu computador. Se voc\u00ea j\u00e1 efetuou a instala\u00e7\u00e3o mas o AwardWallet continua dizendo que a extens\u00e3o n\u00e3o foi instalada, voc\u00ea deve verificar duas coisas: <ol class=\"counter-list\"> <li>Certificar-se de que a extens\u00e3o foi realmente habilitada. Aqui temos duas capturas de tela que podem ajud\u00e1-lo nisto:<br \/> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/39-1.png\" style=\"width: 675px; height: 427px;\" \/><br \/> <br \/> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/39-2.png\" style=\"width: 741px; height: 450px;\" \/><\/li> <li>Certifique-se de ter reiniciado completamente o Internet Explorer <span class=\"bold\">ap\u00f3s<\/span> habilitar a extens\u00e3o. Na maioria dos casos, fechar todas as janelas do navegador \u00e9 necess\u00e1rio, mas \u00e0 vezes deve-se reiniciar o computador.&nbsp;<\/li> <\/ol> Se estas etapas n\u00e3o surtirem efeito, voc\u00ea pode tentar desinstalar a extens\u00e3o e instal\u00e1-la de novo do zero. \u00c9 assim que se desinstala a extens\u00e3o:<br \/> <br \/> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/39-3.png\" style=\"width: 780px; height: 526px;\" \/><br \/> <br \/> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/39-4.png\" style=\"width: 780px; height: 480px;\" \/>", "faq", "pt");
