t.add("answer.44", "Sim, voc\u00ea pode habilitar a autentica\u00e7\u00e3o com dois fatores no seu perfil, tornando seu perfil no AwardWaller muito mais seguro. Em um n\u00edvel mais alto, isto significa que voc\u00ea usar\u00e1 o seu telefone para gerar um c\u00f3digo \u00fanico, al\u00e9m do seu nome de usu\u00e1rio e senha, para se conectar ao AwardWallet. &nbsp;Se voc\u00ea n\u00e3o sabe o que \u00e9 autentica\u00e7\u00e3o com dois fatores, pode ler este <a href=\"https:\/\/en.wikipedia.org\/wiki\/Two-factor_authentication\">artigo Wiki<\/a> ou apenas fazer uma <a href=\"https:\/\/www.google.com\/webhp?&amp;q=what+is+two+factor+authentication\">pesquisa no Google<\/a>.&nbsp;<br \/> <br \/> A configura\u00e7\u00e3o da autentica\u00e7\u00e3o com dois fatores \u00e9 f\u00e1cil; primeiro voc\u00ea baixa o aplicativo Google Aythenticator para seu dispositivo <a href=\"https:\/\/play.google.com\/store\/apps\/details?id=com.google.android.apps.authenticator2&amp;hl=en\">Android<\/a>, <a href=\"https:\/\/itunes.apple.com\/us\/app\/google-authenticator\/id388497605?mt=8\">iOS<\/a> ou <a href=\"http:\/\/www.windowsphone.com\/en-US\/apps\/021dd79f-0598-e011-986b-78e7d1fa76f8\">Windows Phone<\/a> device. Ent\u00e3o, voc\u00ea clica em \u201c<a href=\"https:\/\/awardwallet.com\/user\/edit.php\">Configura\u00e7\u00e3o<\/a>\u201d no cabe\u00e7alho \"Autentica\u00e7\u00e3o com dois fatores\" no seu <a href=\"https:\/\/awardwallet.com\/user\/edit.php\">perfil AwardWallet<\/a>. Ap\u00f3s isto, voc\u00ea ver\u00e1 um c\u00f3digo QR especial que precisa ser escaneado pelo aplicativo Google Authenticator para configura\u00e7\u00e3o:<br \/> &nbsp; <div class=\"t-center\"><img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/44.png\" style=\"width: 650px; height: 700px;\" \/><\/div> <br \/> <br \/> Ent\u00e3o, voc\u00ea digita o c\u00f3digo gerado pelo aplicativo no AwardWallet e est\u00e1 pronto. Para mais detalhes, veja esta dica:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/26-two-factor-authentication\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/26-two-factor-authentication\/<\/a>\n", "faq", "pt");
t.add("answer.45", "Na interface da Internet, ap\u00f3s a sua p\u00e1gina de contas terminar de carregar, basta digitar o nome da conta que deseja ver e ela ser\u00e1 exibida. Veja mais detalhes nesta dica:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/1-filter-accounts\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/1-filter-accounts\/<\/a>", "faq", "pt");
t.add("answer.5", "N\u00e3o. O AwardWallet.com n\u00e3o pode inscrev\u00ea-lo em um programas de recompensa, tampouco adicionar milhas ou pontos aos seus programas de fidelidade. O AwardWallet pode ajud\u00e1-lo a controlar os seus saldos de programas de recompensa ao entrar, em seu nome, nos websites que t\u00eam as informa\u00e7\u00f5es de saldo. N\u00e3o podemos adicionar milhas ao seu programa; apenas o titular do programa de recompensas pode faz\u00ea-lo. Seria necess\u00e1rio entrar em contato com a cia. a\u00e9rea na qual viajou e solicitar o cr\u00e9dito de milhas \u00e0 sua conta. Ent\u00e3o, use o AwardWallet para controlar os seus saldos. O AwardWallet \u00e9 especialmente \u00fatil se voc\u00ea for participante de v\u00e1rios programas de recompensa de v\u00e1rias cias. a\u00e9reas, hot\u00e9is, cart\u00f5es de cr\u00e9dito, etc.", "faq", "pt");
