t.add("answer.8", "N\u00e3o. O AwardWallet foi desenvolvido para controlar os seus saldos de programas de recompensa ao entrar, em seu nome, nos websites que t\u00eam as informa\u00e7\u00f5es de saldo. N\u00f3s n\u00e3o somos, de nenhuma forma, afiliados a esses websites (por ex., hilton.com, jetblue.com, etc.), portanto ser\u00e1 necess\u00e1rio resolver quaisquer assuntos relacionados \u00e0 sua conta diretamente com o respons\u00e1vel pelo programa de recompensas. Por exemplo, se voc\u00ea n\u00e3o sabe como entrar no site &nbsp;da hilton.com para consultar o seu saldo no Hilton Honors, voc\u00ea dever\u00e1 ir ao site hilton.com e resolver o problema diretamente com eles antes de poder usar o AwardWallet.", "faq", "pt");
t.add("answer.9", "<div class=\"_counter-wrap\"><span class=\"_green-blk\">1<\/span> O principal motivo deste erro s\u00e3o credenciais inv\u00e1lidas. Antes que o AwardWallet possa recuperar suas informa\u00e7\u00f5es de saldo, voc\u00ea precisa se certificar de que consegue se conectar ao website do programa e ver o seu saldo. Desta forma voc\u00ea pode verificar se est\u00e1 inserindo login e senha v\u00e1lidos: <\/div> <div class=\"_counter-wrap\"><span class=\"_gray-blk\">a<\/span> <div>V\u00e1 at\u00e9 o AwardWallet e clique no link \"Editar\" ao lado do programa em quest\u00e3o.<\/div> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/09-1.png\" style=\"width: 400px; height: 78px;\" \/><\/div> <div class=\"_counter-wrap\"><span class=\"_gray-blk\">b<\/span> <div>Clique em \"Mostrar senha\" logo embaixo do campo da sua senha.<\/div> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/09-2.png\" style=\"width: 396px; height: 72px;\" \/><\/div> <div class=\"_counter-wrap\"><span class=\"_gray-blk\">c<\/span> <div>Neste momento, voc\u00ea ser\u00e1 solicitado a digitar a sua senha mestre AwardWallet. Digite e clique em Mostrar. &nbsp;Depois disso, voc\u00ea dever\u00e1 ver tanto o seu nome de usu\u00e1rio quanto senha em texto leg\u00edvel.<\/div> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/09-3.png\" style=\"width: 400px; height: 238px;\" \/><\/div> <div class=\"_counter-wrap\"><span class=\"_gray-blk\">d<\/span> <div>Copie o seu nome de usu\u00e1rio e senha e cole-os &nbsp;(n\u00e3o simplesmente redigite)&nbsp;nos campos de entrada do website do programa em quest\u00e3o.<\/div> <\/div> <div class=\"_counter-wrap\"><span class=\"_green-blk\">2<\/span> Se o website do provedor fizer perguntas sobre o seu perfil ap\u00f3s o login depois que voc\u00ea responder \u00e0s perguntas, o AwardWallet n\u00e3o poder\u00e1 consultar o seu saldo.<\/div> <div class=\"_counter-wrap\"><span class=\"_green-blk\">3<\/span> Se escolheu salvar suas senhas localmente, \u00e9 poss\u00edvel que voc\u00ea tenha apagado cookies ou trocado de computador.<\/div> <div class=\"_counter-wrap\"><span class=\"_green-blk\">4<\/span> Tamb\u00e9m \u00e9 poss\u00edvel ter havido altera\u00e7\u00e3o no website do programa que o AwardWallet n\u00e3o tenha tomado conhecimento. Se nenhum destes for o caso, por favor <a class=\"a14pxBlue blue-link\" href=\"\/contact.php\">envie-nos uma mensagem<\/a> e faremos o nosso melhor para resolver o problema.<\/div>", "faq", "pt");
