t.add("answer.48", "Primeiro, voc\u00ea deve atualizar as suas contas e, depois, clicar no sinal de + ao lado do programa e alternar para a guia \"Hist\u00f3rico\". Os detalhes das transa\u00e7\u00f5es mais recentes ser\u00e3o exibidos. Para mais detalhes, veja esta dica:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/4-individual-transaction-history\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/4-individual-transaction-history\/<\/a>", "faq", "pt");
t.add("answer.52", "Sim, basta <a href=\"https:\/\/awardwallet.com\/agents\/add\">adicionar o nome dos seus familiares ao seu perfil<\/a> e, ent\u00e3o, ser\u00e1 poss\u00edvel associar contas de programas de fidelidade a determinados familiares. Para mais detalhes, veja esta dica:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/8-track-accounts-for-family\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/8-track-accounts-for-family\/<\/a>", "faq", "pt");
t.add("answer.53", "Sim, voc\u00ea pode (e deve) ter c\u00f3pia de seguran\u00e7a das suas senhas&nbsp;se&nbsp;decidir armazen\u00e1-las localmente. Voc\u00ea pode fazer isto selecionando as contas das quais deseja ter c\u00f3pias de seguran\u00e7a e, depois, a op\u00e7\u00e3o \"Fazer c\u00f3pia de seguran\u00e7a de senhas\" no menu \"A\u00e7\u00f5es\". &nbsp;Para mais detalhes, veja esta dica:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/9-backup-your-passwords\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/9-backup-your-passwords\/<\/a>", "faq", "pt");
t.add("answer.56", "Sim, voc\u00ea pode <a href=\"https:\/\/awardwallet.com\/agents\/add-connection\">vincular suas contas<\/a> e, ent\u00e3o, selecionar quais contas deseja compartilhar com quem e qual n\u00edvel de acesso deseja fornecer. Para mais detalhes, consulte esta dica:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/12-sharing-account-information\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/12-sharing-account-information\/<\/a>", "faq", "pt");
t.add("answer.68", "Antes de mais nada, obrigado! Em segundo lugar, sim n\u00f3s <a href=\"\/faqs#28\">temos um programa de afiliados<\/a>, e todos os nossos banners, capturas de telas e logos est\u00e3o perfeitamente organizados <a href=\"https:\/\/awardwallet.com\/media\/logos\">nesta p\u00e1gina<\/a> que, a prop\u00f3sito, sempre pode ser acessada se voc\u00ea clicar com o bot\u00e3o direito (ou option+clique) no nosso logo, no topo de qualquer p\u00e1gina. Para mais detalhes, consulte esta dica:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/27-logos-and-banners\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/27-logos-and-banners\/<\/a>", "faq", "pt");
t.add("answer.70", "Para excluir uma das contas de programas de fidelidade do seu perfil no AwardWallet, basta&nbsp;selecionar a conta marcando a caixa de sele\u00e7\u00e3o ao lado dela; ent\u00e3o, voc\u00ea ver\u00e1 um bot\u00e3o com uma lata de lixo no menu que, quando clicado, excluir\u00e1 todas as contas selecionadas.<br \/> <br \/> <img alt=\"\" src=\"https:\/\/awardwallet.com\/images\/uploaded\/fck\/faq\/en\/70-1.png\" style=\"width: 650px; height: 383px;\" \/>", "faq", "pt");
t.add("answer.71", "Primeiramente, confirme novamente se est\u00e1 digitando o c\u00f3digo correto. Se estiver 100% certo disso, talvez seja um problema de sincroniza\u00e7\u00e3o de hor\u00e1rio. Se o hor\u00e1rio no seu laptop for 13:00&nbsp; e o hor\u00e1rio no telefone em que o c\u00f3digo estiver sendo gerado for 13:03, isto causaria um problema. Nesse caso, voc\u00ea deve <a href=\"https:\/\/www.google.com\/search?q=how+to+sync+clock+on+android\">sincronizar&nbsp;o rel\u00f3gio do seu telefone<\/a> e tentar novamente.", "faq", "pt");
