t.add("answer.74", "O Acompanhamento de saldo monitora contas de fidelidade para alert\u00e1-lo assim que o saldo mudar. Pontos da American Express, Chase, Citi, Marriott e Capital One n\u00e3o s\u00e3o lan\u00e7ados instantanemante quando voc\u00ea os transfere para programas de fidelidade parceiros.&nbsp;<br \/> <br \/> Quando encontrar disponibilidade para algum voo ou hotel, use o servi\u00e7o para ter certeza de pode confirmar a reserva antes que n\u00e3o haja mais disponibilidade. Ap\u00f3s a ativa\u00e7\u00e3o, o AwardWallet vai monitorar sua conta frequentemente e enviar uma mensagem para a sua \u00e1rea de trabalho, celular ou e-mail assim que detectar mudan\u00e7as.&nbsp;<br \/> <br \/> Aqui voc\u00ea pode assistir a um r\u00e1pido v\u00eddeo de explica\u00e7\u00e3o, gravados pelos nossos amigos do TripAstute:<br \/> &nbsp; <div style=\"max-width:640px; width: 100%\"> <div style=\"position: relative; padding-bottom: 56.25%\"><iframe allowfullscreen=\"\" frameborder=\"0\" mozallowfullscreen=\"\" src=\"https:\/\/player.vimeo.com\/video\/329111256\" style=\"width: 100%; height: 100%; position: absolute; top:0; left: 0\" webkitallowfullscreen=\"\"><\/iframe><\/div> <\/div>", "faq", "pt");
t.add("question.74", "O que s\u00e3o cr\u00e9ditos de Acompanhamento de saldo?", "faq", "pt");
t.add("answer.75", "A ferramenta <a href=\"https:\/\/awardwallet.com\/merchants\">Merchant Lookup Tool<\/a> do AwardWallet permite que os usu\u00e1rios pesquisem lojas e identifiquem como essas lojas est\u00e3o classificadas nas transa\u00e7\u00f5es de cart\u00f5es de cr\u00e9dito. Isso \u00e9 importante para maximizar os ganhos de pontos que voc\u00ea pode ganhar com determinado cart\u00e3o.<br \/> <br \/> Algumas das categorias mais comuns que ganham b\u00f4nus de cart\u00f5es de cr\u00e9dito s\u00e3o mercados, combust\u00edvel, viagens e restaurantes. Para descobrir, basta pesquisar pela loja em quest\u00e3o usando o Merchant Lookup Tool e ele &nbsp;ir\u00e1 exibir uma lista de cart\u00f5es de cr\u00e9dito confirmados que ganham mais de 1 ponto por d\u00f3lar na loja em quest\u00e3o.<br \/> <br \/> Aqui temos um v\u00eddeo com uma explica\u00e7\u00e3o r\u00e1pida:<br \/> <div style=\"max-width:640px; width: 100%\"> <div style=\"position: relative; padding-bottom: 56.25%\"><iframe allowfullscreen=\"\" frameborder=\"0\" mozallowfullscreen=\"\" src=\"https:\/\/player.vimeo.com\/video\/360577226\" style=\"width: 100%; height: 100%; position: absolute; top:0; left: 0\" webkitallowfullscreen=\"\"><\/iframe><\/div> <\/div>", "faq", "pt");
t.add("question.75", "O que \u00e9 a ferramenta Merchant Lookup Tool do AwardWallet?", "faq", "pt");
t.add("answer.76", "AwardWallet only uses your Gmail data to retrieve travel reservations and loyalty account statements for the purposes of making the AwardWallet&#39;s service work. AwardWallet&#39;s use of information received, and AwardWallet&#39;s transfer of information to any other app, from Google APIs will adhere to Google&#39;s Limited Use Requirements. In addition to that none of your personal data that you have stored in AwardWallet is ever transmitted to any third party without your prior explicit written consent.", "faq", "pt");
