t.add("pay-subscription.product.description.long", "%p_on%O AwardWallet Plus \u00e9 um servi\u00e7o em forma de assinatura; o per\u00edodo de assinatura \u00e9 de um ano e, no momento da assinatura, a renova\u00e7\u00e3o autom\u00e1tica \u00e9 configurada para ser realizada anualmente. O custo da assinatura \u00e9 se US$ 30,00 por ano sem o desconto para primeiros apoiadores e US$ 10,00 por ano com o desconto para primeiros apoiadores. O AwardWallet Plus oferece a voc\u00ea estes recursos adicionais:%p_off%%list_on% %item_on%Exibi\u00e7\u00e3o de itens adicionais de contas de programas de recompensa%item_off%%item_on%Exibi\u00e7\u00e3o de todas as datas de validade das suas contas de fidelidade, quando as datas s\u00e3o conhecidas%item_off%%item_on%A atualiza\u00e7\u00e3o das contas \u00e9 feita em paralelo, at\u00e9 5x mais r\u00e1pido%item_off%%item_on%Monitora\u00e7\u00e3o e acompanhamento mais abrangente dos seus voos%item_off% %list_off%%p_on%Assinaturas AwardWallet Plus compradas no aplicativo ser\u00e3o cobradas na sua conta %store_name% e ser\u00e3o renovadas automaticamente em at\u00e9 24 horas antes do fim do per\u00edodo atual de assinatura, a menos que a renova\u00e7\u00e3o autom\u00e1tica seja desabilitada anteriormente. Para administrar suas assinaturas ou desabilitar a renova\u00e7\u00e3o autom\u00e1tica, ap\u00f3s a compra, acesse as configura\u00e7\u00f5es da sua conta %store_name%. Nenhum reembolso ser\u00e1 concedido ap\u00f3s a cobran\u00e7a da assinatura anual. Qualquer per\u00edodo gratuito de teste de n\u00e3o usado ser\u00e1 cancelado ap\u00f3s a compra de uma assinatura.%p_off%%p_on%Para saber mais detalhes, n\u00e3o deixe de consultar nossas %link_1%Condi\u00e7\u00f5es de utiliza\u00e7\u00e3o%link_off% e nossa %link_2%Pol\u00edtica de privacidade%link_off%.%p_off%", "mobile", "pt");
