t.add("accessing_your_data.1", "Os nossos clientes podem sempre consultar, atualizar ou alterar informa\u00e7\u00f5es pessoais acessando sua pr\u00f3pria conta. A AwardWallet tamb\u00e9m ir\u00e1, quando voc\u00ea solicitar, inform\u00e1-lo se mantemos, ou processamos em nome de terceiros, quaisquer das suas informa\u00e7\u00f5es pessoais.\u00a0%link_on%Entre em contato conosco aqui%link_off%\u00a0se precisar de ajuda para consultar as suas informa\u00e7\u00f5es. A AwardWallet responder\u00e1 ao seu pedido de acesso para consulta das suas informa\u00e7\u00f5es que temos em arquivo dentro de um prazo razo\u00e1vel.", "privacy", "pt");
t.add("accessing_your_data.2", "Se voc\u00ea for residente do EEE, \"informa\u00e7\u00f5es pessoais\" s\u00e3o definidas como quaisquer informa\u00e7\u00f5es de identifica\u00e7\u00e3o pessoal ou outros dados recolhidos que possam direta ou indiretamente identific\u00e1-lo. Voc\u00ea pode ter direitos adicionais conforme as leis de prote\u00e7\u00e3o de dados do EEE, tais como:", "privacy", "pt");
t.add("accessing_your_data.2.1", "Acesso: Direito de solicitar o acesso e uma c\u00f3pia das suas informa\u00e7\u00f5es pessoais;", "privacy", "pt");
t.add("accessing_your_data.2.2", "Restri\u00e7\u00e3o: Voc\u00ea pode pedir para n\u00f3s restringirmos o processamento das suas informa\u00e7\u00f5es pessoais em determinadas circunst\u00e2ncias;", "privacy", "pt");
t.add("accessing_your_data.2.3", "Retifica\u00e7\u00e3o: Pode ter quaisquer imprecis\u00f5es nas suas informa\u00e7\u00f5es pessoais corrigidas;", "privacy", "pt");
t.add("accessing_your_data.2.4", "Elimina\u00e7\u00e3o: Voc\u00ea pode pedir para n\u00f3s eliminarmos as suas informa\u00e7\u00f5es pessoais sob determinadas circunst\u00e2ncias (por exemplo, se as informa\u00e7\u00f5es j\u00e1 n\u00e3o forem mais necess\u00e1rias para os fins para os quais foram recolhidas);", "privacy", "pt");
t.add("accessing_your_data.2.5", "Objetivo: Voc\u00ea tamb\u00e9m pode n\u00e3o concordar com o processamento das suas informa\u00e7\u00f5es pessoais em determinadas circunst\u00e2ncias;", "privacy", "pt");
t.add("accessing_your_data.2.6", "Retirada do consentimento: Onde dependermos do seu consentimento para processar as suas informa\u00e7\u00f5es pessoais, voc\u00ea tem o direito de recusar o consentimento e\/ou, caso tenha dado, de retir\u00e1-lo a qualquer momento. Isso n\u00e3o afetar\u00e1 a licitude do processamento antes da retirada do seu consentimento.", "privacy", "pt");
t.add("accessing_your_data.2.7", "Portabilidade: Voc\u00ea pode pedir para n\u00f3s fornecermos as suas informa\u00e7\u00f5es pessoais em um formato estruturado, de uso comum e leg\u00edvel por m\u00e1quina em determinadas circunst\u00e2ncias.", "privacy", "pt");
t.add("accessing_your_data.3", "Voc\u00ea pode exercer os direitos acima\u00a0%link_on%entrando em contato conosco%link_off%\u00a0e examinaremos esses pedidos de acordo com as leis de prote\u00e7\u00e3o de dados aplic\u00e1veis. N\u00f3s poderemos pedir para voc\u00ea comprovar a sua identidade antes de respondermos ao seu pedido.", "privacy", "pt");
t.add("accessing_your_data.4", "Voc\u00ea tamb\u00e9m pode ter o direito de fazer, a qualquer momento, perguntas ou reclama\u00e7\u00f5es junto ao \u00f3rg\u00e3o de prote\u00e7\u00e3o de dados da sua jurisdi\u00e7\u00e3o.", "privacy", "pt");
t.add("accessing_your_data.5", "N\u00f3s poderemos transferir informa\u00e7\u00f5es pessoais para empresas que nos ajudam a prestar o nosso servi\u00e7o, e quando o fizermos, tais transfer\u00eancias para terceiros estar\u00e3o cobertas por contratos de transfer\u00eancia adequados. N\u00f3s manteremos os dados pessoais que processarmos em nome dos nossos clientes conforme necess\u00e1rio para prestar servi\u00e7os aos mesmos. Al\u00e9m disso, iremos reter essas informa\u00e7\u00f5es pessoais conforme necess\u00e1rio para cumprir nossas obriga\u00e7\u00f5es legais, resolver disputas e cumprir nossos contratos.", "privacy", "pt");
t.add("accessing_your_data.6", "A AwardWallet est\u00e1 sediada nos Estados Unidos. As informa\u00e7\u00f5es que coletadas e mantemos podem ser transferidas para, ou controladas e processadas nos Estados Unidos e\/ou em outros pa\u00edses do mundo. Ao fornecer informa\u00e7\u00f5es para n\u00f3s, ou usar nosso(s) website(s) e servi\u00e7os, voc\u00ea concorda com tal transfer\u00eancia. N\u00f3s iremos proteger a privacidade e a seguran\u00e7a das informa\u00e7\u00f5es pessoais que coletamos de acordo com esta Pol\u00edtica de Privacidade, independentemente de onde forem processadas ou estiverem armazenadas.", "privacy", "pt");
t.add("accessing_your_data.header", "Acesso aos seus dados", "privacy", "pt");
t.add("california_privacy_rights.header", "Lei de Privacidade do Consumidor da Calif\u00f3rnia (California Consumer Privacy Act)", "privacy", "pt");
t.add("california_privacy_rights.link", "Clique aqui para ler as informa\u00e7\u00f5es adicionais necess\u00e1rias ao relacionadas \u00e0 Lei de Privacidade do Consumidor da Calif\u00f3rnia (em ingl\u00eas).", "privacy", "pt");
t.add("communicating.1", "A AwardWallet pode precisar se comunicar com voc\u00ea por v\u00e1rias raz\u00f5es, incluindo:", "privacy", "pt");
t.add("communicating.1.1", "Respostas \u00e0s suas perguntas e solicita\u00e7\u00f5es. Se voc\u00ea entrar em contato conosco com um problema ou pergunta, usaremos as suas informa\u00e7\u00f5es para responder.", "privacy", "pt");
t.add("communicating.1.2", "Envio de e-mails com mensagens de car\u00e1ter administrativo e de servi\u00e7o. N\u00f3s podermos contat\u00e1-lo para inform\u00e1-lo sobre altera\u00e7\u00f5es em nossos Servi\u00e7o, em nossas ofertas de Servi\u00e7o e avisos importantes relacionados ao Servi\u00e7o, como avisos relacionados a seguran\u00e7a e fraudes. Esses e-mails e mensagens s\u00e3o considerados uma parte necess\u00e1ria dos Servi\u00e7os e voc\u00ea n\u00e3o pode optar por n\u00e3o receb\u00ea-las.", "privacy", "pt");
t.add("communicating.1.3", "Envio de e-mails sobre novos produtos ou outras not\u00edcias sobre a AwardWallet que achamos que gostaria de receber de n\u00f3s ou de nossos parceiros comerciais. Voc\u00ea pode optar por n\u00e3o receber esse tipo de mensagens a qualquer momento, clicando no link de cancelamento na parte inferior de cada comunica\u00e7\u00e3o.", "privacy", "pt");
t.add("communicating.1.4", "Oferta programas de indica\u00e7\u00e3o e de incentivos, que permitam que voc\u00ea utilize e-mails, textos ou links de URLs que voc\u00ea pode compartilhar com amigos ou colegas.", "privacy", "pt");
t.add("communicating.header", "Comunica\u00e7\u00f5es", "privacy", "pt");
t.add("contents.header", "Conte\u00fado:", "privacy", "pt");
t.add("data_collection_info.1", "N\u00f3s coletamos v\u00e1rios tipos diferentes de informa\u00e7\u00f5es para fornecer a voc\u00ea os Servi\u00e7os, incluindo:", "privacy", "pt");
t.add("data_collection_info.10", "Se pedirmos a voc\u00ea que forne\u00e7a informa\u00e7\u00f5es pessoais para cumprir uma exig\u00eancia legal ou para fornecer Servi\u00e7os, deixaremos isso claro no momento relevante e o informaremos se o fornecimento das suas informa\u00e7\u00f5es pessoais \u00e9 obrigat\u00f3rio ou n\u00e3o (bem como das poss\u00edveis consequ\u00eancias caso decida n\u00e3o fornecer as suas informa\u00e7\u00f5es pessoais).", "privacy", "pt");
t.add("data_collection_info.11", "Da mesma forma, se coletarmos e usarmos as suas informa\u00e7\u00f5es pessoais com base nos nossos interesses leg\u00edtimos ou de terceiros e tais interesses ainda n\u00e3o estiverem listados acima, deixaremos claro para voc\u00ea, no momento relevante, quais s\u00e3o esses interesses leg\u00edtimos.", "privacy", "pt");
t.add("data_collection_info.12", "Se voc\u00ea tiver d\u00favidas ou precisar de mais informa\u00e7\u00f5es sobre a base jur\u00eddica na qual coletamos e usamos as suas informa\u00e7\u00f5es pessoais,\u00a0%link_on%entre em contato conosco%link_off%.", "privacy", "pt");
t.add("data_collection_info.2", "%bold_on%Dados de registro e de conta de cliente:%bold_off% Estes incluem informa\u00e7\u00f5es que voc\u00ea fornece para criar sua conta junto a n\u00f3s e podem incluir nome e sobrenome, informa\u00e7\u00f5es de programas de fidelidade externos (incluindo informa\u00e7\u00f5es de acesso \u00e0 conta), informa\u00e7\u00f5es de reservas de viagens, senhas e endere\u00e7o de e-mail v\u00e1lido.", "privacy", "pt");
t.add("data_collection_info.3", "Dados de servi\u00e7o (incluindo dados de sess\u00e3o e utiliza\u00e7\u00e3o):", "privacy", "pt");
t.add("data_collection_info.4", "Quando voc\u00ea usa os nossos Servi\u00e7os, recebemos informa\u00e7\u00f5es geradas pelo uso do servi\u00e7o, ou pela pr\u00f3pria infraestrutura do servi\u00e7o, (por exemplo, dura\u00e7\u00e3o da sess\u00e3o, informa\u00e7\u00f5es de conex\u00e3o, etc.). Tamb\u00e9m podemos recolher dados de utiliza\u00e7\u00e3o e registro sobre a forma como os servi\u00e7os s\u00e3o acessados e utilizados, incluindo informa\u00e7\u00f5es sobre o dispositivo em que voc\u00ea est\u00e1 utilizando os Servi\u00e7os, endere\u00e7os IP, informa\u00e7\u00f5es de localiza\u00e7\u00e3o, defini\u00e7\u00f5es de idioma, o sistema operacional que voc\u00ea utiliza, identificadores \u00fanicos de dispositivos e outros dados de diagn\u00f3stico para nos ajudar a fornecer os Servi\u00e7os. Consulte a Se\u00e7\u00e3o 3 \"Anal\u00edtica, cookies e outras tecnologias de sites da Internet\", para mais informa\u00e7\u00f5es sobre os dados de servi\u00e7o.", "privacy", "pt");
t.add("data_collection_info.5", "%bold_on%Dados de terceiros:%bold_off%\u00a0N\u00f3s poderemos receber informa\u00e7\u00f5es sobre voc\u00ea de outras fontes, incluindo de programas de recompensa ou fidelidade externos (aos quais voc\u00ea nos deu permiss\u00e3o para acessar) bancos de dados dispon\u00edveis publicamente ou de outros parceiros externos de quem adquirimos dados, e combinar esses dados com informa\u00e7\u00f5es que j\u00e1 temos sobre voc\u00ea. Tamb\u00e9m poderemos receber informa\u00e7\u00f5es de outras empresas afiliadas que fazem parte do nosso grupo empresarial. Isso nos ajuda a atualizar, expandir e analisar os nossos registros, identificar novas oportunidades de marketing e a fornecer produtos e servi\u00e7os que possam ser do seu interesse.", "privacy", "pt");
t.add("data_collection_info.6", "%bold_on%Informa\u00e7\u00f5es de localiza\u00e7\u00e3o:%bold_off%\u00a0Coletamos informa\u00e7\u00f5es com base na localiza\u00e7\u00e3o e o endere\u00e7o IP com o objetivo de fornecer e dar apoio ao servi\u00e7o e para a preven\u00e7\u00e3o de fraudes e monitoramento da seguran\u00e7a.", "privacy", "pt");
t.add("data_collection_info.7", "%bold_on%Informa\u00e7\u00f5es do dispositivo:%bold_off%\u00a0Quando voc\u00ea usa os nossos Servi\u00e7os, n\u00f3s coletamos automaticamente informa\u00e7\u00f5es sobre o tipo de dispositivo que voc\u00ea usa, a vers\u00e3o do sistema operacional e o identificador \u00fanico do dispositivo (ou \"UDID\").", "privacy", "pt");
t.add("data_collection_info.8", "%bold_on%Base jur\u00eddica para processamento (apenas para residentes do EEE):%bold_off%\u00a0Se voc\u00ea reside no EEE, a nossa base jur\u00eddica para coleta e uso das informa\u00e7\u00f5es pessoais descritas acima depender\u00e1 das informa\u00e7\u00f5es pessoais em quest\u00e3o e do contexto espec\u00edfico em que as coletamos. Se voc\u00ea for residente do EEE, \"informa\u00e7\u00f5es pessoais\" s\u00e3o definidas como quaisquer informa\u00e7\u00f5es de identifica\u00e7\u00e3o pessoal ou outros dados recolhidos que possam direta ou indiretamente identific\u00e1-lo.", "privacy", "pt");
t.add("data_collection_info.9", "No entanto, n\u00f3s normalmente coletamos informa\u00e7\u00f5es pessoais suas quando obtemos o seu consentimento para faz\u00ea-lo, quando precisarmos das informa\u00e7\u00f5es pessoais para executar os Servi\u00e7os ou quando tal processamento for do nosso interesse leg\u00edtimo e isso n\u00e3o estiver em conflito com seus interesses de prote\u00e7\u00e3o de dados ou seus direitos e liberdades fundamentais. Em alguns casos, n\u00f3s tamb\u00e9m poderemos ter a obriga\u00e7\u00e3o legal de coletar as informa\u00e7\u00f5es pessoais em quest\u00e3o.", "privacy", "pt");
t.add("data_collection_info.header", "Informa\u00e7\u00f5es que coletamos e recebemos", "privacy", "pt");
t.add("info_sharing.1", "Garantir a sua privacidade \u00e9 importante para n\u00f3s, n\u00f3s levamos muito a s\u00e9rio a nossa responsabilidade de proteger as suas informa\u00e7\u00f5es pessoais. Conforme permitido, poderemos compartilhar certas informa\u00e7\u00f5es e dados de pesquisa agregados com terceiros, conforme descrito nesta Pol\u00edtica de Privacidade. Estes terceiros incluem:", "privacy", "pt");
t.add("info_sharing.2", "%bold_on%Fornecedores e prestadores de servi\u00e7os terceirizados.%bold_off%\u00a0N\u00f3s usamos servi\u00e7os de terceiros que nos ajudam a realizar as nossas opera\u00e7\u00f5es comerciais di\u00e1rias; estes s\u00e3o alguns exemplos de tais opera\u00e7\u00f5es:", "privacy", "pt");
t.add("info_sharing.2.1", "Hospedagem e fornecimento dos servi\u00e7os AwardWallet", "privacy", "pt");
t.add("info_sharing.2.2", "Atendimento ao cliente", "privacy", "pt");
t.add("info_sharing.2.3", "Entrega de comunica\u00e7\u00f5es por e-mail", "privacy", "pt");
t.add("info_sharing.2.4", "Armazenamento, anal\u00edtica e manuten\u00e7\u00e3o de dados", "privacy", "pt");
t.add("info_sharing.2.5", "Infraestrutura de computa\u00e7\u00e3o em nuvem", "privacy", "pt");
t.add("info_sharing.3", "Esses prestadores de servi\u00e7os terceirizados t\u00eam acesso a informa\u00e7\u00f5es pessoais apenas conforme o necess\u00e1rio para desempenho das suas fun\u00e7\u00f5es e devem processar informa\u00e7\u00f5es pessoais de acordo com esta Pol\u00edtica de Privacidade. Se transferirmos quaisquer das suas informa\u00e7\u00f5es pessoais para um terceiro que atue como nossos agente, seremos respons\u00e1veis por quaisquer atos desses agentes externos que sejam inconsistentes com esta Pol\u00edtica de Privacidade, salvo disposi\u00e7\u00e3o em contr\u00e1rio por lei.", "privacy", "pt");
t.add("info_sharing.4", "%bold_on%Parceiros de marketing e anal\u00edtica.%bold_off%\u00a0N\u00f3s usamos certos parceiros de marketing e anal\u00edtica, como Google Analytics, Facebook Analytics, Sparkpost, etc., para que nos ajudem a comercializar os nossos produtos e a entender como os nossos usu\u00e1rios usam os nossos servi\u00e7os, com o objetivo melhor\u00e1-los. Tais parceiros externos podem receber informa\u00e7\u00f5es sobre o seu uso dos nossos servi\u00e7os e, potencialmente, informa\u00e7\u00f5es sobre as suas visitas a outros servi\u00e7os online. Esses parceiros externos s\u00f3 est\u00e3o autorizados a usar as suas informa\u00e7\u00f5es para fornecerem seus servi\u00e7os para n\u00f3s.", "privacy", "pt");
t.add("info_sharing.5", "%bold_on%Parceiros de publicidade.%bold_off%\u00a0N\u00f3s colaboramos com parceiros de publicidade para que possamos personalizar o conte\u00fado publicit\u00e1rio que voc\u00ea poder\u00e1 receber ao usar nossos Servi\u00e7os. Consulte a Se\u00e7\u00e3o 3, \"Tecnologias de rastreamento\", para mais informa\u00e7\u00f5es sobre o assunto.", "privacy", "pt");
t.add("info_sharing.6", "%bold_on%Pesquisas da AwardWallet.%bold_off%\u00a0N\u00f3s poderemos compartilhar dados an\u00f4nimos e despersonalizados (que n\u00e3o cont\u00eam qualquer informa\u00e7\u00e3o de identifica\u00e7\u00e3o pessoal) com terceiros. Por exemplo, fazemos pesquisas usando dados agregados recolhidos dos nossos usu\u00e1rios para criar, usar e compartilhar determinados relat\u00f3rios setoriais, como an\u00e1lise de satisfa\u00e7\u00e3o de um programa de fidelidade ou an\u00e1lises gerais de tend\u00eancias de viagens. Os dados agregados n\u00e3o identificam voc\u00ea pessoalmente, e n\u00e3o ser\u00e3o tratados como informa\u00e7\u00f5es pessoais conforme esta Pol\u00edtica de Privacidade. N\u00f3s tamb\u00e9m podemos divulgar suas informa\u00e7\u00f5es pessoais a terceiros, mas apenas com o seu consentimento pr\u00e9vio. O uso de informa\u00e7\u00f5es recebidas pela AwardWallet das APIs Google ou das APIs Verizon Media Oauth se dar\u00e1 conforme a\u00a0%link_on%Google API Services User Data Policy (em ingl\u00eas)%link_off%, incluindo os Requisitos de Uso Limitado e os Requisitos de Uso Limitado da Verizon Media, respetivamente.", "privacy", "pt");
t.add("info_sharing.7", "%bold_on%Conformidade legal.%bold_off%\u00a0Em certos casos, a AwardWallet pode ser obrigada por lei a divulgar informa\u00e7\u00f5es pessoais. Por exemplo, podemos divulgar as suas informa\u00e7\u00f5es para cumprir uma intima\u00e7\u00e3o v\u00e1lida ou outro processo legal; quando acreditarmos de boa-f\u00e9 que a divulga\u00e7\u00e3o seja necess\u00e1ria para proteger os nossos direitos ou para proteger a sua seguran\u00e7a (ou a seguran\u00e7a de outros); para investigar fraudes; para responder a um pedido do governo; ou para satisfazer pedidos de \u00f3rg\u00e3os de manuten\u00e7\u00e3o da ordem p\u00fablica ou de seguran\u00e7a nacional. Tamb\u00e9m poderemos divulgar as suas informa\u00e7\u00f5es a terceiros como parte de uma fus\u00e3o, venda de ativos da empresa, financiamento ou aquisi\u00e7\u00e3o de toda ou parte do nosso neg\u00f3cio por outra empresa em que informa\u00e7\u00f5es dos clientes sejam um dos ativos transferidos.", "privacy", "pt");
t.add("info_sharing.header", "Compartilhamento de informa\u00e7\u00f5es", "privacy", "pt");
t.add("info_usage_policy.1", "A AwardWallet pode acessar (o que pode incluir, com o seu consentimento, visualiza\u00e7\u00e3o ou escuta limitadas) e usar os dados que coletamos conforme necess\u00e1rio (a) para fornecer e manter os Servi\u00e7os; (b) para tratar e responder a problemas de servi\u00e7o, seguran\u00e7a e suporte ao cliente; (c) para detectar, prevenir ou tratar de assuntos relacionados a fraudes, seguran\u00e7a, quest\u00f5es legais ou t\u00e9cnicas; (d) conforme exigido por lei; (e) para cumprir os nossos contratos; (f) para melhorar e melhorar os Servi\u00e7os; (g) para fornecer an\u00e1lises ou informa\u00e7\u00f5es valiosas para os nossos clientes e utilizadores.", "privacy", "pt");
t.add("info_usage_policy.2", "Alguns exemplos espec\u00edficos de como usamos as informa\u00e7\u00f5es:", "privacy", "pt");
t.add("info_usage_policy.2.1", "Cria\u00e7\u00e3o e administra\u00e7\u00e3o da sua conta", "privacy", "pt");
t.add("info_usage_policy.2.10", "Servi\u00e7os comerciais dos nossos parceiros de neg\u00f3cios externos", "privacy", "pt");
t.add("info_usage_policy.2.2", "Envio de confirma\u00e7\u00e3o de pedido", "privacy", "pt");
t.add("info_usage_policy.2.3", "Facilita\u00e7\u00e3o e melhora da utiliza\u00e7\u00e3o dos servi\u00e7os solicitados por voc\u00ea", "privacy", "pt");
t.add("info_usage_policy.2.4", "Envio de atualiza\u00e7\u00f5es de produtos, comunicados de marketing e informa\u00e7\u00f5es de servi\u00e7o", "privacy", "pt");
t.add("info_usage_policy.2.5", "Resposta a consultas de clientes e pedidos de suporte", "privacy", "pt");
t.add("info_usage_policy.2.6", "Realiza\u00e7\u00e3o de pesquisas e an\u00e1lise", "privacy", "pt");
t.add("info_usage_policy.2.7", "Exibi\u00e7\u00e3o de conte\u00fado com base nos seus interesses", "privacy", "pt");
t.add("info_usage_policy.2.8", "An\u00e1lise de dados, incluindo por meio de sistemas automatizados e aprendizado de m\u00e1quina para melhorar os nossos servi\u00e7os e\/ou a sua experi\u00eancia", "privacy", "pt");
t.add("info_usage_policy.2.9", "Fornecimento a voc\u00ea de informa\u00e7\u00f5es sobre o uso dos servi\u00e7os e valores de refer\u00eancia, insights e sugest\u00f5es para melhorias", "privacy", "pt");
t.add("info_usage_policy.3", "A AwardWallet manter\u00e1 as suas informa\u00e7\u00f5es enquanto a sua conta estiver ativa conosco de forma cumprir com as nossas obriga\u00e7\u00f5es legais, resolver disputas e fazer garantir o cumprimento dos nossos contratos.", "privacy", "pt");
t.add("info_usage_policy.4", "Se desejar cancelar a sua conta ou quiser que n\u00f3s paremos de prestar servi\u00e7os a voc\u00ea, ou se tivermos informa\u00e7\u00f5es pessoais suas e voc\u00ea queira que elas sejam removidas do nosso banco de dados ou sejam inativadas, voc\u00ea pode fazer isso clicando\u00a0%link_on%aqui%link_off%.", "privacy", "pt");
t.add("info_usage_policy.header", "Como usamos as informa\u00e7\u00f5es que coletamos e recebemos", "privacy", "pt");
t.add("intro.contact_info", "Caso voc\u00ea tenha tiver alguma d\u00favida sobre esta Pol\u00edtica de Privacidade ou nossas pr\u00e1ticas,\u00a0%link_on%entre em contato conosco%link_off%. Caso voc\u00ea resida do Espa\u00e7o Econ\u00f4mico Europeu (\"EEE\") e tenha uma quest\u00e3o de privacidade ou de utiliza\u00e7\u00e3o de dados n\u00e3o resolvida que n\u00e3o tenhamos abordado de forma satisfat\u00f3ria, entre em contato com nosso parceiro terceirizado para resolu\u00e7\u00e3o de lit\u00edgios (gratuita), localizado nos EUA, atrav\u00e9s do e-mail\u00a0%link2_on%http:\/\/go.adr.org\/privacyshield.html%link2_off%.", "privacy", "pt");
t.add("intro.header", "Introdu\u00e7\u00e3o", "privacy", "pt");
t.add("intro.pp_info", "Esta Pol\u00edtica de Privacidade ir\u00e1 ajud\u00e1-lo a compreender quais informa\u00e7\u00f5es recolhemos e utilizamos na AwardWallet e as escolhas que voc\u00ea associou a essas informa\u00e7\u00f5es. Quando nos referimos a \"AwardWallet\", \"n\u00f3s\", \"nosso\" ou \"nos\" nesta pol\u00edtica, estamos nos referindo \u00e0 AwardWallet, LLC, que fornece os Servi\u00e7os a voc\u00ea. Os \"Servi\u00e7os\" referem-se aos aplicativos, servi\u00e7os e websites (marketing e produto) fornecidos pela AwardWallet. A AwardWallet pode, de tempos em tempos, introduzir novos produtos e servi\u00e7os. \u00c0 medida em que estes novos produtos e servi\u00e7os afetarem esta Pol\u00edtica, n\u00f3s notificaremos voc\u00ea conforme descrito na Se\u00e7\u00e3o 10 abaixo. O uso das informa\u00e7\u00f5es coletadas atrav\u00e9s do nosso servi\u00e7o ser\u00e1 limitado \u00e0 finalidade de fornecer os Servi\u00e7os aos nossos clientes conforme especificado nesta Pol\u00edtica.", "privacy", "pt");
t.add("other_questions", "Caso tenha ainda mais alguma d\u00favida sobre esta Pol\u00edtica de Privacidade,\u00a0%link_on%entre em contato conosco%link_off%.", "privacy", "pt");
t.add("privacy_shield_compliance.1", "A AwardWallet est\u00e1 em conformidade com as Diretrizes Privacy Shield (Escudo de Privacidade) tanto entre UE-EUA quanto Su\u00ed\u00e7a-EUA estabelecidas pelo Departamento de Com\u00e9rcio dos Estados Unidos relacionadas \u00e0 coleta, uso e reten\u00e7\u00e3o de informa\u00e7\u00f5es pessoais transferidas da Uni\u00e3o Europeia e da Su\u00ed\u00e7a para os Estados Unidos. A AwardWallet confirmou junto ao Departamento de Com\u00e9rcio que adere aos Princ\u00edpios do Privacy Shield. Se houver algum conflito entre os termos desta Pol\u00edtica de Privacidade e os Princ\u00edpios do Privacy Shield, os Princ\u00edpios do Privacy Shield prevalecer\u00e3o. Para saber mais sobre o programa Privacy Shield e para ver a nossa certifica\u00e7\u00e3o, visite\u00a0%link_on%https:\/\/www.privacyshield.gov\/%link_off%.", "privacy", "pt");
t.add("privacy_shield_compliance.header", "Conformidade com o Privacy Shield (Escudo de Privacidade)", "privacy", "pt");
t.add("question_complaint.1", "Em conformidade com os Princ\u00edpios do Privacy Shield, a AwardWallet compromete-se a resolver reclama\u00e7\u00f5es sobre a nossa coleta ou utiliza\u00e7\u00e3o das suas informa\u00e7\u00f5es pessoais. Residentes da UE e da Su\u00ed\u00e7a com perguntas ou reclama\u00e7\u00f5es sobre a nossa pol\u00edtica relacionada ao Privacy Shield devem primeiro\u00a0%link_on%entrar em contato com a AwardWallet aqui%link_off%.", "privacy", "pt");
t.add("question_complaint.2", "A AwardWallet tamb\u00e9m se comprometeu a encaminhar reclama\u00e7\u00f5es relacionadas ao Private Shield n\u00e3o resolvidas \u00e0\u00a0%link_on%Associa\u00e7\u00e3o Americana de Arbitragem (American Arbitration Association)%link_off%, uma entidade alternativa de resolu\u00e7\u00e3o de disputas localizada nos Estados Unidos. Caso voc\u00ea n\u00e3o tenha recebido de n\u00f3s uma confirma\u00e7\u00e3o em tempo oportuno da sua ou caso n\u00f3s n\u00e3o tenhamos tratado da sua reclama\u00e7\u00e3o de maneira satisfat\u00f3ria, entre em contato ou visite\u00a0%link2_on%https:\/\/go.adr.org\/privacyshield.html%link2_off%\u00a0para obter mais informa\u00e7\u00f5es ou para apresentar uma reclama\u00e7\u00e3o. Os servi\u00e7os da Associa\u00e7\u00e3o Americana de Arbitragem ser\u00e3o fornecidos sem custos para voc\u00ea.", "privacy", "pt");
t.add("question_complaint.3", "Voc\u00ea pode, em circunst\u00e2ncias limitadas, invocar arbitragem vinculativa para reclama\u00e7\u00f5es n\u00e3o resolvidas pelos mecanismos acima. Informa\u00e7\u00f5es adicionais podem ser encontradas em\u00a0%link_on%https:\/\/www.privacyshield.gov\/article?id=ANNEX-I-introduction%link_off%.", "privacy", "pt");
t.add("question_complaint.4", "A AwardWallet est\u00e1 sujeito aos poderes de investiga\u00e7\u00e3o e aplica\u00e7\u00e3o da U.S. Federal Trade Commission (Comiss\u00e3o Federal de Com\u00e9rcio dos EUA) no que diz respeito ao nosso cumprimento das Diretrizes Privacy Shield, tanto entre UE-EUA quanto Su\u00ed\u00e7a-EUA.", "privacy", "pt");
t.add("question_complaint.header", "Perguntas ou reclama\u00e7\u00f5es", "privacy", "pt");
t.add("security.1", "A AwardWallet segue padr\u00f5es globalmente aceitos para proteger as informa\u00e7\u00f5es pessoais que nos s\u00e3o enviadas, tanto durante a transmiss\u00e3o quanto ap\u00f3s o recebimento; no entanto, nenhuma medida de seguran\u00e7a \u00e9 perfeita. Recomendamos proteger a sua senha e\u00a0%link_on%implementar a autentica\u00e7\u00e3o de dois fatores na sua conta%link_off%, uma vez que esta \u00e9 uma das formas mais f\u00e1ceis de gerenciar a seguran\u00e7a da sua conta pessoal. Lembre-se de que, se perder o controle da sua senha, voc\u00ea poder\u00e1 perder o controlo das suas informa\u00e7\u00f5es pessoais.", "privacy", "pt");
t.add("security.header", "Seguran\u00e7a", "privacy", "pt");
t.add("statement_changes.1", "N\u00f3s poderemos atualizar esta Pol\u00edtica de Privacidade para refletir altera\u00e7\u00f5es \u00e0s nossas pr\u00e1ticas relacionadas a informa\u00e7\u00f5es. No caso de quaisquer altera\u00e7\u00f5es materiais, faremos um aviso neste website, e podemos notificar voc\u00ea por e-mail (enviado para o endere\u00e7o de e-mail especificado na sua conta), antes de qualquer altera\u00e7\u00e3o entrar em vigor. N\u00f3s incentivamos voc\u00ea a consultar esta p\u00e1gina periodicamente para obter as informa\u00e7\u00f5es mais recentes sobre nossas pr\u00e1ticas relacionadas a privacidade. Se continuar a utilizar os Servi\u00e7os depois de tais altera\u00e7\u00f5es entrarem em vigor, voc\u00ea estar\u00e1 concordando com a pol\u00edtica revista.", "privacy", "pt");
t.add("statement_changes.header", "Altera\u00e7\u00f5es a esta Declara\u00e7\u00e3o", "privacy", "pt");
t.add("web_tech_terms.1", "A AwardWallet est\u00e1 continuamente aprimorando nossos websites e produtos atrav\u00e9s do uso de v\u00e1rias ferramentas de anal\u00edtica de Internet de parceiros externos, que nos ajudam a entender como os visitantes usam os nossos websites, ferramentas de desktop e aplicativos m\u00f3veis, o que eles gostam e n\u00e3o gostam, e onde eles podem ter problemas.", "privacy", "pt");
t.add("web_tech_terms.10", "Usamos software de anal\u00edtica para dispositivos m\u00f3veis para nos permitir compreender melhor a funcionalidade do nosso software para dispositivos m\u00f3veis no seu telefone celular. O software pode registrar informa\u00e7\u00f5es como a frequ\u00eancia com que voc\u00ea usa o aplicativo, os eventos que ocorrem dentro do aplicativo, uso agregado, dados de desempenho e de onde o aplicativo foi baixado. N\u00e3o vinculamos as informa\u00e7\u00f5es que armazenamos no software de anal\u00edtica a quaisquer informa\u00e7\u00f5es pessoais que voc\u00ea inserir no aplicativo m\u00f3vel.", "privacy", "pt");
t.add("web_tech_terms.11", "Redes sociais: Os nossos sites incluem recursos de redes sociais, como a entrada na nossa p\u00e1gina de grupo do Facebook. Esses recursos podem coletar o seu endere\u00e7o IP, a p\u00e1gina que est\u00e1 visitando no nosso site, e podem instalar um cookie para que o recurso funcione corretamente. Estes servi\u00e7os tamb\u00e9m verificar\u00e3o a sua identidade e oferecer\u00e3o para voc\u00ea a op\u00e7\u00e3o de compartilhar conosco certas informa\u00e7\u00f5es pessoais, como o seu nome e endere\u00e7o de e-mail, para preenchimento autom\u00e1tico do nosso formul\u00e1rio de inscri\u00e7\u00e3o ou fornecer feedback. As suas intera\u00e7\u00f5es com esses recursos s\u00e3o regidas pela pol\u00edtica de privacidade da empresa que as fornece.", "privacy", "pt");
t.add("web_tech_terms.2", "Geolocaliza\u00e7\u00e3o e outros dados:", "privacy", "pt");
t.add("web_tech_terms.3", "N\u00f3s poderemos utilizar dados precisos de geolocaliza\u00e7\u00e3o, mas apenas se voc\u00ea optar especificamente pela coleta desses dados em conex\u00e3o com um determinado servi\u00e7o. N\u00f3s tamb\u00e9m usamos informa\u00e7\u00f5es como endere\u00e7os IP para determinar as \u00e1reas de localiza\u00e7\u00e3o geogr\u00e1fica geral dos nossos visitantes. Os web beacons usados em conjunto com essas ferramentas de an\u00e1lise da web podem coletar dados como o navegador ou sistema operacional que uma pessoa usa, bem como nomes de dom\u00ednio, tipos de MIME e que conte\u00fado, os produtos e servi\u00e7os vistos ou descarregados quando visitam ou se registam para servi\u00e7os em um dos nossos websites ou utilizam uma dos nossos aplicativos para dispositivos m\u00f3veis.", "privacy", "pt");
t.add("web_tech_terms.4", "Google Analytics e Adobe Marketing Cloud:", "privacy", "pt");
t.add("web_tech_terms.5", "Usamos o Google Analytics conforme descrito em\u00a0%link_on%\"Como o Google usa informa\u00e7\u00f5es de sites ou apps que utilizam nossos servi\u00e7os.\"%link_off%\u00a0Voc\u00ea pode impedir que os seus dados sejam utilizados pelo Google Analytics em websites instalando\u00a0%link2_on%aqui%link2_off%\u00a0o complemento de exclus\u00e3o do Google Analytics para navegadores. Tamb\u00e9m empregamos o mascaramento de endere\u00e7os IP, uma t\u00e9cnica usada para truncar endere\u00e7os IP coletados pelo\u00a0%link3_on%Google Analytics%link3_off%\u00a0e os armazenamos de forma abreviada para impedir que seja feito o rastreamento at\u00e9 os usu\u00e1rios individuais.", "privacy", "pt");
t.add("web_tech_terms.6", "Tecnologias de rastreamento:", "privacy", "pt");
t.add("web_tech_terms.7", "A AwardWallet e seus parceiros usam cookies e tecnologias de rastreamento semelhantes para rastrear padr\u00f5es de tr\u00e1fego de usu\u00e1rios e manter certas informa\u00e7\u00f5es de registro. Tecnologias de rastreamento tamb\u00e9m usadas s\u00e3o beacons, tags e scripts com o intuito coletar e rastrear informa\u00e7\u00f5es e para melhorar e analisar o nosso servi\u00e7o. Se voc\u00ea n\u00e3o quiser que as informa\u00e7\u00f5es que essas tecnologias coletam sejam usadas para fornecer an\u00fancios direcionados, voc\u00ea pode optar por n\u00e3o participar na \u00e1rea de perfil da sua conta. O menu \"Ajuda\" da barra de menus da maioria dos navegadores ir\u00e1 dizer-lhe como impedir que o seu navegador aceite novos cookies, como fazer que o navegador o notifique quando receber um novo cookie e como desativar completamente os cookies. Voc\u00ea ainda pode consultar individualmente o site se optar por configurar o seu navegador para recusar todos os cookies; no entanto, \u00e9 necess\u00e1rio ativar cookies para criar uma conta e instalar os Servi\u00e7os.", "privacy", "pt");
t.add("web_tech_terms.8", "Exemplos de cookies que usamos:", "privacy", "pt");
t.add("web_tech_terms.8.1.label", "Tipo de cookie", "privacy", "pt");
t.add("web_tech_terms.8.1.value.11", "Cookies de sess\u00e3o", "privacy", "pt");
t.add("web_tech_terms.8.1.value.12", "Usamos estes cookies para realizar a opera\u00e7\u00e3o dos nossos websites.", "privacy", "pt");
t.add("web_tech_terms.8.1.value.13", "Alguns cookies s\u00e3o essenciais para o funcionamento dos websites da AwardWallet. Se um usu\u00e1rio optar por desativar esses cookies, ele poder\u00e1 n\u00e3o ter acesso a todo o conte\u00fado e recursos.", "privacy", "pt");
t.add("web_tech_terms.8.1.value.21", "Cookies de prefer\u00eancias", "privacy", "pt");
t.add("web_tech_terms.8.1.value.22", "N\u00f3s usamos estes cookies para lembrar das suas prefer\u00eancias.", "privacy", "pt");
t.add("web_tech_terms.8.1.value.23", "Quando voc\u00ea se inscreve em um website da AwardWallet, n\u00f3s usamos cookies para armazenar identificadores de usu\u00e1rios \u00fanicos e atribu\u00eddos aleatoriamente que geramos para fins administrativos. Esses cookies permitem a voc\u00ea acessar os sites da AwardWallet sem ter que iniciar uma nova sess\u00e3o toda as vezes.", "privacy", "pt");
t.add("web_tech_terms.8.1.value.31", "Cookies de publicidade", "privacy", "pt");
t.add("web_tech_terms.8.1.value.32", "Esses cookies s\u00e3o usados para exibirmos an\u00fancios que possam ser relevantes para voc\u00ea e compat\u00edveis com os seus interesses.", "privacy", "pt");
t.add("web_tech_terms.8.1.value.33", "Usamos cookies para tornar a publicidade mais atraente para os usu\u00e1rios, e tamb\u00e9m para ajudar na cria\u00e7\u00e3o de relat\u00f3rios de anal\u00edtica e desempenho e de programas de marketing.", "privacy", "pt");
t.add("web_tech_terms.8.1.value.41", "Cookies de seguran\u00e7a", "privacy", "pt");
t.add("web_tech_terms.8.1.value.42", "Esses cookies s\u00e3o usados para fins gerais de seguran\u00e7a e autentica\u00e7\u00e3o dos usu\u00e1rios.", "privacy", "pt");
t.add("web_tech_terms.8.1.value.43", "Usamos cookies de seguran\u00e7a para autenticar usu\u00e1rios, impedir o uso fraudulento de credenciais de login e proteger os dados de usu\u00e1rios contra o acesso por pessoas n\u00e3o autorizadas.", "privacy", "pt");
